import React from 'react';
import PopupWithForm from './PopupWithForm';

export default function InfoToolTip({ open, onClose, isRegistered }) {
  return (
    <PopupWithForm
      isOpen={isOpen}
      onClose={onClose}
      isRegistered={isRegistered}
    >
      <div
        className={
          isRegistered ? 'popup__register_registered' : 'popup__register_error'
        }
      >
        {isRegistered
          ? '¡Correcto! Ya estás registrado.'
          : 'Uy, algo salió mal. Por favor, inténtalo de nuevo.'}
      </div>
    </PopupWithForm>
  );
}
